import React, { Component } from 'react';
import ButtonArticle from './ButtonArcticle';
import { Container, Button, Row, Col, Card as BootstrapCard} from 'react-bootstrap';

class Card extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }

    render() {
        console.log(this.props);
        let myComponent;

        if (this.props.article != undefined) { 
            myComponent = <Col lg={4} md={6} mb={4}>
            <Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src="holder.js/100px180" />
  <Card.Body>
    <Card.Title>Card Title</Card.Title>
    <Card.Text>
      Some quick example text to build on the card title and make up the bulk of
      the card's content.
    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card>
            <BootstrapCard style={{width: "18rem"}}>
                <BootstrapCard.Img variante="top" src={this.props.article.cover}></BootstrapCard.Img>
                <BootstrapCard.Body>
                    <BootstrapCard.Title></BootstrapCard.Title>
                    <BootstrapCard.Texte></BootstrapCard.Texte>
                </BootstrapCard.Body>
                <BootstrapCard.Footer>
                    <ButtonArticle onClick={this.props.addArticle}></ButtonArticle>
                </BootstrapCard.Footer>
            </BootstrapCard>
            </Col>
         } else { 
             myComponent = null;
          }
        return ( 

            myComponent
             );
    }
}
 
export default Card;
